swaptrade_mid_dialog_desc_est_network_fe:
En transacciones de bridge, esta comisión incluye las comisiones de red tanto de la red de origen como del bridge cross-chain.

La comisión de esta transacción se muestra de la siguiente manera:
· Comisión de red de {chain}: {value1}
· Comisión de red del bridge de {bridge}: {value2}

No cobramos comisiones de red ya que son pagos para los mineros.

swaptrade_intro_dialog_desc_cross_value_:
La diferencia de valor de esta transacción se muestra de la siguiente manera:
· Comisión de la blockchain {chain}: {value1}
· Comisión del bridge {bridge}: {value2}

Si la diferencia de valor es muy grande, pero las comisiones que aparecen más arriba son relativamente pequeñas, esto se debe a que la cantidad del bridge ha afectado a la profundidad del pool de liquidez del par de tokens.

swaptrade_intro_tooltip_trade_including_:
En las transacciones de bridge, el coste incluye las comisiones de red de la red de pago y una parte de las comisiones del bridge cross-chain. Desglose de comisiones de esta transacción:
• Comisión de red: {fromChainPriceAndFee}
• Comisión de bridge cross-chain: {bridgePriceAndFee}
La comisión de red cubre el coste de los mineros y no las cobra nuestra plataforma.

